‚†Ä
‚ÄúI love Maxfield Parish‚Äôs artwork. ‚ÄúStars‚Äù (pictured above) reflects the dreams and aspirations I had as a young man; the vibrant blue captures the whimsy of our boundless imagination and is starkly juxtaposed against realities of our earthly surroundings. But the woman shows us hope, looking towards the stars and endless possibilities, and in this hope, she becomes the embodiment of limitless wonder. Just like our galaxy.‚Äù - Jen (as interpreted by me for the sake of eloquence)‚†Ä
‚†Ä
This design had many iterations, my dad‚Äôs fondest one had a tiara of glittering jewels which he had stuck to the shirt. Now he has become disenchanted with the design but maybe with a few tweaks, he can sophisticate the design to more readily capture what he loves so much about Parish‚Äôs work. ‚†Ä
‚†Ä
Max Parish has been an inspiration for my father and mother, naming their retail furniture store after one of his more illustrious paintings, Black Orpheus. I think his work maintains a base in reality, divulging into an iridescent dream-scape through the classical representation of man and woman, immediately capturing those drawn to the classic arts whilst attending to the abstract in a colourful revelry for beauty. ‚†Ä
‚†Ä
A lot of people have been struggling with lockdown here in #melbourne, and this photo made me think of all those suffering during this really bad period. It might not mean a lot but if anyone just needs someone to talk to, feel free to reach out to us. Sometimes just a kind word, a small conversation, or just someone to listen makes all the difference.‚†Ä
